$(document).ready(function () {
  $(".upload-div").hide();
  $(".file-edit-btns").hide();
  $(".btn-details-fileup").click(function () {
    $(".capture-div").hide();
    $(".upload-div").show();
    $(".file-edit-btns").show();
  });
  var cropper;
  var data;
  var res;
  var redirectFunction = '';
  var indexHeadshot = 1;
  var canvas = document.querySelector("#canvas");
  var video = document.querySelector("#videoElement");
  var inpFile = document.getElementById("hsFile");
  var previewContainer = document.getElementById("img-preview");
  var previewImg = document.querySelector(".img-preview-img");
  var previewDefaultTxtCam = document.querySelector(".img-preview-default-txtCam");
  var previewDefaultTxt = document.querySelector(".img-preview-default-txt"); // $('li.splide__slide').click(function () {
  // 	var index = $(this).attr("data-index");
  // 	if(index){
  // 		indexHeadshot = index;
  // 		console.log('Headshot: '+indexHeadshot);
  // 	}	
  // });

  $(".manageHeadshot").find("button").click(function () {
    var index = $(this).attr("data-indexheadshot");

    if (index) {
      indexHeadshot = index;
      console.log('Headshot: ' + indexHeadshot);
    }
  });

  if (inpFile) {
    inpFile.addEventListener("change", function () {
      var file = this.files[0];

      if (file) {
        var reader = new FileReader();
        reader.addEventListener("load", function () {
          //console.log(this);
          previewDefaultTxt.style.display = "none";
          previewImg.setAttribute("src", this.result);
          previewImg.style.display = "block";
          cropper = new (cropperjs__WEBPACK_IMPORTED_MODULE_2___default())(previewImg, {
            viewMode: 1,
            aspectRatio: 1,
            initialAspectRatio: 1
          });
        });
        reader.readAsDataURL(file);
      }
    });
  }

  if (navigator.mediaDevices.getUserMedia) {
    navigator.mediaDevices.getUserMedia({
      video: true
    }).then(function (stream) {
      previewDefaultTxtCam.style.display = "none";
      video.style.display = "block";
      video.srcObject = stream;
    })["catch"](function (error) {
      console.log("Looks like your device has no camera.");
      $('#resHeadshotWrapper').empty();
      $('#resHeadshotWrapper').prepend('<div class="alert alert-warning alert-dismissible"> \
													<button type="button" class="close" data-dismiss="alert">&times;</button> \
													Looks like your device has no camera. \
												</div>');
    });
  }

  function takepicture(height, width) {
    var context = canvas.getContext('2d');

    if (width && height) {
      canvas.width = width;
      canvas.height = height;
      context.drawImage(video, 0, 0, width, height);
      data = canvas.toDataURL('image/png');
      previewDefaultTxt.style.display = "none";
      previewImg.style.display = "block";
      previewImg.setAttribute('src', data);
      cropper = new (cropperjs__WEBPACK_IMPORTED_MODULE_2___default())(previewImg, {
        viewMode: 1,
        aspectRatio: 1,
        initialAspectRatio: 1
      }); //console.log(data);
    }
  }

  $(".btn-details-cptr").click(function (e) {
    e.preventDefault();
    console.log('capturing...');
    $(".upload-div").show();
    $(".file-edit-btns").show(); //console.log(video.offsetHeight,video.offsetWidth);

    takepicture(video.offsetHeight, video.offsetWidth);
    $(".capture-div").hide();
  });
  $('#rotate-anticlock').on('click', function () {
    console.log('rotate anticlock');

    if (cropper) {
      cropper.rotate(-90);
    }
  });
  $('#rotate-clock').on('click', function () {
    console.log('rotate clock');

    if (cropper) {
      cropper.rotate(90);
    }
  }); // ADD/EDIT HEADSHOT

  $('#saveHeadshot').on('click', function () {
    console.log('uploading...');

    if (cropper) {
      canvas = cropper.getCroppedCanvas({
        width: 400,
        height: 400
      });
      canvas.toBlob(function (blob) {
        URL.createObjectURL(blob);
        var reader = new FileReader();
        reader.readAsDataURL(blob);

        reader.onloadend = function () {
          var base64data = reader.result; //console.log(base64data);

          $.ajax({
            url: SCI_HEADSHOT.request_url,
            method: 'POST',
            data: {
              headshot: base64data,
              nonce: SCI_HEADSHOT.nonce,
              action: 'sci_add_headshot',
              index: indexHeadshot
            },
            success: function success(response, status, xhr) {
              res = JSON.parse(response); //console.log(response, status, xhr.status);

              cropper.destroy();
              cropper = null;

              if (res.status === 'success') {
                redirectFunction = 'onclick="headshotSuccess()"';
              }

              $('#resHeadshotWrapper').empty();
              $('#resHeadshotWrapper').prepend('<div class="alert alert-' + res.status + ' alert-dismissible"> \
																		<button ' + redirectFunction + ' type="button" class="close" data-dismiss="alert">&times;</button> \
																		' + res.msg + '. \
																	</div>');
            }
          });
        };
      });
    } else {
      console.log('please capture or upload a headshot');
      $('#resHeadshotWrapper').empty();
      $('#resHeadshotWrapper').prepend('<div class="alert alert-warning alert-dismissible"> \
														<button type="button" class="close" data-dismiss="alert">&times;</button> \
														Please capture or upload a headshot. \
													</div>');
    }
  }); // DELETE HEADSHOT

  $('#deleteheadshotsave_submit').click(function () {
    var res;
    $.ajax({
      url: Edit.request_url,
      method: 'POST',
      data: {
        index: indexHeadshot,
        nonce: Edit.nonce,
        action: 'sci_delete_headshot'
      },
      success: function success(response, status, xhr) {
        res = JSON.parse(response);
        $('#resdeleteheadshotWrapper').empty();
        $('#resdeleteheadshotWrapper').prepend('<div class="alert alert-' + res.status + ' alert-dismissible"> \
															<button type="button" class="close" data-dismiss="alert">&times;</button> \
															' + res.msg + '. \
														</div>');

        if (res.status === 'success') {
          window.location.reload();
        }
      },
      error: function error(xhr, status, _error) {
        console.log(xhr, status, _error);
      }
    });
  });
}); //Spotlight toggle

